import React from 'react';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
  const navigate = useNavigate();

  const styles = {
    container: {
      fontFamily: "'Inter', sans-serif",
      color: '#333',
      backgroundColor: '#fff',
      minHeight: '100vh',
      display: 'flex',
      flexDirection: 'column'
    },
    // --- NAVBAR ---
    navbar: {
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      padding: '20px 50px',
      backgroundColor: '#fff',
      position: 'sticky',
      top: 0,
      zIndex: 1000,
      boxShadow: '0 2px 10px rgba(0,0,0,0.05)'
    },
    logoContainer: {
      display: 'flex',
      alignItems: 'center',
      gap: '10px',
      cursor: 'pointer'
    },
    logoIcon: {
      width: '35px',
      height: '35px',
      borderRadius: '8px',
      objectFit: 'cover'
    },
    logoText: {
      fontSize: '20px',
      fontWeight: '800',
      color: '#1f2937' // Dark grey
    },
    navLinks: {
      display: 'flex',
      gap: '30px'
    },
    link: {
      textDecoration: 'none',
      color: '#4b5563', // Grey text
      fontSize: '15px',
      fontWeight: '500',
      cursor: 'pointer',
      transition: 'color 0.2s'
    },
    authButtons: {
      display: 'flex',
      gap: '15px',
      alignItems: 'center'
    },
    loginBtn: {
      background: 'none',
      border: 'none',
      fontSize: '15px',
      fontWeight: '600',
      cursor: 'pointer',
      color: '#1f2937'
    },
    signupBtn: {
      padding: '10px 20px',
      backgroundColor: '#2563eb', // Blue
      color: '#fff',
      border: 'none',
      borderRadius: '8px',
      fontSize: '15px',
      fontWeight: '600',
      cursor: 'pointer'
    },

    // --- HERO SECTION ---
    hero: {
      flex: 1,
      background: 'linear-gradient(135deg, #378b5a 0%, #1e5a38 100%)', // Green gradient from your image
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      padding: '60px',
      color: '#fff',
      gap: '50px',
      flexWrap: 'wrap'
    },
    heroContent: {
      flex: 1,
      maxWidth: '600px'
    },
    title: {
      fontSize: '48px',
      fontWeight: '800',
      marginBottom: '20px',
      lineHeight: '1.2'
    },
    subtitle: {
      fontSize: '18px',
      opacity: 0.9,
      marginBottom: '30px',
      lineHeight: '1.6'
    },
    heroBtn: {
      padding: '15px 30px',
      backgroundColor: '#2563eb', // Blue button
      color: '#fff',
      border: 'none',
      borderRadius: '8px',
      fontSize: '16px',
      fontWeight: 'bold',
      cursor: 'pointer'
    },
    heroImageContainer: {
      flex: 1,
      maxWidth: '600px',
      borderRadius: '20px',
      overflow: 'hidden',
      boxShadow: '0 20px 40px rgba(0,0,0,0.2)'
    },
    heroImage: {
      width: '100%',
      height: '100%',
      objectFit: 'cover',
      display: 'block'
    }
  };

  return (
    <div style={styles.container}>

      {/* NAVBAR */}
      <nav style={styles.navbar}>
        {/* LOGO SECTION */}
        <div style={styles.logoContainer} onClick={() => navigate('/')}>
          {/* Replace this URL with your actual logo image file */}
          <img 
            src="https://cdn-icons-png.flaticon.com/512/3135/3135715.png" 
            alt="Logo" 
            style={styles.logoIcon} 
          />
          <span style={styles.logoText}>EventSphere</span>
        </div>

        {/* NAVIGATION LINKS */}
        <div style={styles.navLinks}>
          <span style={styles.link}>Home</span>
          <span style={styles.link}>Events</span>
          <span style={styles.link}>Workshops</span>
          <span style={styles.link}>About</span>
        </div>

        {/* AUTH BUTTONS */}
        <div style={styles.authButtons}>
          <button style={styles.loginBtn} onClick={() => navigate('/signin')}>Log in</button>
          <button style={styles.signupBtn} onClick={() => navigate('/signup')}>Sign up free</button>
        </div>
      </nav>

      {/* HERO SECTION */}
      <header style={styles.hero}>
        <div style={styles.heroContent}>
          <h1 style={styles.title}>
            <span style={{color: '#4ade80'}}>EVENTSPHERE</span> <br />
            The Ultimate Campus Event Management Platform...!
          </h1>
          <p style={styles.subtitle}>
            Streamline event planning, boost student engagement, and simplify 
            venue booking. The all-in-one platform built for modern universities.
          </p>
          <button style={styles.heroBtn} onClick={() => navigate('/signup')}>Get Started</button>
        </div>

        <div style={styles.heroImageContainer}>
          {/* Using a placeholder concert image similar to your screenshot */}
          <img 
            src="https://images.unsplash.com/photo-1492684223066-81342ee5ff30?w=800&q=80" 
            alt="Event Crowd" 
            style={styles.heroImage} 
          />
        </div>
      </header>

    </div>
  );
};

export default LandingPage;
